import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from "react-bootstrap";

const CustomButton = (props) => {
  return (
    <Link to={props.to}>
      <Button
        variant="outline-primary"
      >
        <h4 className='m-0'>{props.label}</h4>
      </Button>
    </Link>
  );
}

export default CustomButton;
